sources.sass\\layout\\_gallery.scss:
.gallery {
  padding-top: 40px;
  padding-bottom: 40px;
  background-image: linear-gradient(#fff5f6 41.5%, #ffffff 41.5%);
}

.gallery__thumb {
  display: flex;
  justify-content: center;
  align-items: center;
  flex-wrap: wrap;
  margin: -1px;
}

.picture__wrapper {
  border-radius: 7px;
  overflow: hidden;
}

.picture__wrapper {
  transform: scale(100%);
  transition: transform 250ms cubic-bezier(0.4, 0, 0.2, 1);
  z-index: 0;
}
.picture__wrapper:hover {
  transform: scale(125%);
  z-index: 1;
}

.gallery__column {
  flex-basis: calc((100% - 7 * 2px) / 7);
  margin-left: 1px;
  margin-right: 1px;
}
.gallery__column.big-img {
  flex-basis: calc((100% - 7 * 2px) / 7 * 2);
}

.gallery__column.column-1 {
  position: relative;
  bottom: 2px;
}

.gallery__column.column-2 {
  position: relative;
  top: 4px;
}

.gallery__column.column-4 {
  position: relative;
  top: 9px;
}

.gallery__column.column-5 {
  position: relative;
  bottom: 10px;
}

.gallery__column.column-6 {
  position: relative;
  bottom: 1px;
}

.gallery__row {
  display: flex;
  align-items: flex-start;
  margin-bottom: 2px;

  &.small-img {
    width: 50%;
  }
}

