    background: #FEA5BB;
    border-radius: 50%;

    
    display: flex;
    justify-content: center;
    align-items: center;

    transition: background-color 250ms cubic-bezier(0.4, 0, 0.2, 1);
    
    &:hover,
    &:focus{
        background-color: var(--title-text);
    }

    @media screen and (min-width: 768px){
        height: 34px;
        width: 34px;
    }
}

.social__icon{
    fill: var(--white-text);
}

.social__icon--tel{
    margin-right: 2px;
}

.footer__contact{
    font-weight: 700;
    font-size: 12px;
    line-height: 1.86;
    text-align: right;
    color: var(--main-text);

    @media screen and (min-width: 768px){
        font-size: 14px;
    }

    @media screen and (min-width: 1200px){
        font-size: 16px;
    }
}

.footer__tel{
    color: var(--title-text);
}

.footer__extra {
    display: block;
    font-family: 'DM Sans';
    font-weight: 700;
    line-height: 1.52;
    text-align: center;

    color: var(--second-text);
    align-content: center;
    padding: 16px 60px 20px 60px;

    @media screen and (min-width: 480px){
        line-height: 1.86;
        padding: 8px 60px 8px 60px;
    }
}

.footer__author{
    display: block;
    @media screen and (min-width: 480px){
        display: inline-block;
    }
}
